import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function createNote(noteItem){
    return <Note
        title = {noteItem.title}
        text = {noteItem.text} 
    />
}
function App(){
    return (
    <div>
        <Header />
        notes.map();

        <Footer />
    </div>
    );
}

export default App;
